[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32f446xx_1E0041000451303439343636-if00
restart_method: command

[temperature_sensor rpi]
sensor_type: temperature_host

[temperature_sensor mcu]
sensor_type: temperature_mcu

#virtual sdcard settings
[virtual_sdcard]
path: ~/gcode_files

#enable display status for moonraker
[display_status]

# Enable Pause/Resume Functionality
[pause_resume]

[respond]

#Printer Speeds and Accels
[printer]
kinematics: cartesian
max_velocity: 500
max_accel: 15000 # change this to 7500 after commissioning
max_accel_to_decel: 15000
max_z_velocity: 15   # may be able to increase to 15 after comissioning.
max_z_accel: 100
square_corner_velocity: 15.0 # start at 8, but then increase once you're sure assembly is sound

[force_move]
enable_force_move: true

[exclude_object]

[resonance_holder]

[include mainsail.cfg]
[include power.cfg]
[include toolhead.cfg]
[include xy_steppers.cfg]
[include z_steppers.cfg]
[include homing.cfg]
[include bed.cfg]
# [include probe.cfg]
[include beacon.cfg]
# [include crampon.cfg]
[include fans.cfg]
[include rebreather.cfg]
[include print_start.cfg]
[include print_end.cfg]
# [include nozzle_wipe.cfg]
[include macros.cfg]


# Miscellaneous config

[input_shaper]
shaper_freq_x: 92.0
shaper_type_x: zv
shaper_freq_y: 125.8
shaper_type_y: ei

[temperature_sensor chamber]
sensor_type: ATC Semitec 104GT-2
sensor_pin: PC1

[multi_pin chamber_led_pins]
pins: PB5,PB6

[output_pin chamber_leds]
pin: multi_pin:chamber_led_pins
pwm: true
cycle_time: 0.01
value: 0.5

